import React, {useState} from 'react';
import './App.css';
import {Counter} from "./Counter";
import {MaxMin} from "./Max&&Min";


function App() {

    const [MaxValue, SetMaxValue] = useState(5)
    const [MinValue, SetMinValue] = useState(0)


    const Inc = () => {
        SetMinValue(prevState => prevState + 1)
    }
    const Reset = () => {
        SetMinValue(0)
    }


    return (
        <div className="App">

            <Counter inc={Inc} reset={Reset} disable={MaxValue} StartValue={MinValue}/>
            <MaxMin disable={MaxValue} StartValue={MinValue} />

        </div>
    );
}

export default App;
